    private JSONArray generateShipInfos() {
        List<ShipInfo> datas = ShipInfo.dao.find("select * from ship_info order by id");
        JSONArray result = new JSONArray();
        for (int i = 0; i < datas.size(); i++) {
            ShipInfo shipInfo = datas.get(i);
            result.put(createShipInfo(shipInfo));
        }
        return result;
    }

    private JSONObject createShipInfo(ShipInfo shipInfo) {
        JSONObject result = new JSONObject();
        JSONObject obj = new JSONObject(JsonKit.toJson(shipInfo));
        for (Iterator<String> it = obj.keys(); it.hasNext();) {
            String keyName = it.next();
            if (p.matcher(keyName).matches()) {
                String realName = keyName.substring(0, keyName.length() - 1);
                if (result.opt(realName) == null) {
                    List array = new ArrayList();
                    for (int i = 1; obj.opt(realName + i) != null; i++) {
                        array.add(obj.get(realName + i));
                    }
                    JSONArray convert = new JSONArray(JsonKit.toJson(array));
                    result.put("api_" + realName, convert);
                }
            } else {
                result.put("api_" + keyName, obj.get(keyName));
            }
        }
        return result;
    }
    
