    private JSONObject createShipGraph(ShipGraph shipGraph) {
        JSONObject result = new JSONObject();
        JSONObject obj = new JSONObject(JsonKit.toJson(shipGraph));
        for (Iterator<String> it = obj.keys(); it.hasNext();) {
            String keyName = it.next();
            Object value = obj.get(keyName);
            if ((value instanceof String) && ((String) value).startsWith("[")) {
                result.put("api_" + keyName, new JSONArray((String) value));
            } else {
                result.put("api_" + keyName, value);
            }
        }
        return result;
    }
    
